import React from 'react';

// Componente de prueba simple sin contextos
const TestComponent = () => {
  return (
    <div style={{ 
      minHeight: '100vh', 
      backgroundColor: '#e5f3ff', 
      display: 'flex', 
      alignItems: 'center', 
      justifyContent: 'center' 
    }}>
      <div style={{ 
        backgroundColor: 'white', 
        padding: '2rem', 
        borderRadius: '0.5rem', 
        boxShadow: '0 10px 25px rgba(0,0,0,0.1)' 
      }}>
        <h1 style={{ fontSize: '1.5rem', fontWeight: 'bold', marginBottom: '1rem', color: '#1f2937' }}>
          ¡La aplicación funciona!
        </h1>
        <p style={{ color: '#6b7280' }}>
          Si puedes ver esto, la aplicación está funcionando correctamente.
        </p>
      </div>
    </div>
  );
};

function App() {
  return <TestComponent />;
}

export default App;
